import React from 'react';
import { Container, Row, Col, Form, Button } from 'react-bootstrap';
import { BsPencil, BsClock } from 'react-icons/bs';
import { FaPaperPlane } from 'react-icons/fa';
import { VscSmiley } from 'react-icons/vsc';

const Entry = (props) => {
    const {
        entry
    } = props;

    return (
        <Row>
            <Col>

                <h4 className="month-header">{entry.date}</h4>
                <div className="card">
                    <div className="border-bottom border-disabled mb-2 d-flex justify-content-between">
                        <Form.Label>{entry.time} <BsClock/></Form.Label>
                    </div>
                    <div className="entry-content">
                        {entry.content}
                    </div>
                </div>
            </Col>
        </Row>
    )
}

export default Entry;
